window.addEventListener("load", function load(event) {
  const NavigationMetrics = require('NavigationMetrics');
  NavigationMetrics.addRetroactiveListener(
    NavigationMetrics.Events.NAVIGATION_DONE,
    (queryID, metrics) => {
      if (metrics.pageType !== "normal") {
        return;
      }
      var startTime = metrics.start;
      var tti = Math.floor(metrics.tti - startTime) / 1000;
      var dd = Math.floor(metrics.extras.all_pagelets_displayed - startTime) / 1000;
      var e2e = Math.floor(metrics.e2e - startTime) / 1000;

      console.log('Time to interactive (TTI milestone, important): ' + tti.toFixed(3));
      console.log('Display Done (DD milestone, most important): ' + dd.toFixed(3));
      console.log('End-to-End (E2E milestone, not important): ' + e2e.toFixed(3));
    }
  );
});
